		<h1>80 脂汗を滴らせ…</h1>

		<table width="760">
			<tr>
				<td>
					<p style="font-size: 24px">「ヒューヒュー！　お尻の穴に浣腸器を突っ込まれ懸命に戦う美貌の女戦士アニス！…ってか？」<br>
						「キャハハ！　浣腸されて悶える変態女戦士アニス？　ホント恥知らずなメス豚なんだから」<br>
						　脂汗を滴らせ苦悶の表情で浣腸責めに耐えるアニスを、おもいっきり嘲笑するエリとミキ。</p>
